import React from 'react';
import Navbar from './components/Navbar';
import Header from './components/Header';
import ProjectPreview from './components/ProjectPreview';
import Projects from './components/Projects';

const App = () => {
  return (
    <div>
      <Navbar />
      <Header />
      <Projects />
      <ProjectPreview />
    </div>
  );
};

export default App;
